import './App.css';
import { Box, PageHeader, Grommet } from 'grommet';
import NewTask from './components/NewTask.js';
import TaskBoard from './components/TaskBoard.js';

function App() {
  return (
    <div className="App">
			<Grommet>
				<PageHeader title="Task Manager"/>
				<Box direction="row">
					<NewTask/>
					<TaskBoard/>
				</Box>	
		</Grommet>
    </div>
  );
}

export default App;
